import React, { useState } from 'react';
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import PersonIcon from '@mui/icons-material/Person';
import IconButton from '@mui/material/IconButton';
import ImageIcon from '@mui/icons-material/Image';
import Link from '@mui/material/Link';
import TextField from '@mui/material/TextField';
import SearchIcon from '@mui/icons-material/Search';
import All from'./All'


const Products= (username) =>{
    const [Allflag,setAllflag]=useState(0);
    return (
        
    <div>
        <div style={{borderBottom:'solid'}}> 
        <AppBar position="static" style={colorB}>
            
            
        <Toolbar>
        <IconButton >
                       <ImageIcon />
          </IconButton>
          <Typography   sx={{ flexGrow: 1 }} style={text}>
           App Name
          </Typography>
          <Button style={text1}>{username}</Button>
          <IconButton>
                       <PersonIcon />
          </IconButton>
        </Toolbar>
      </AppBar></div>
      <div className="parentProducts">
<div className="childProducts"> 
   <div className="DivLink">
      <Link href="#"  onClick={() => {
    console.info("I'm a button.");
    
  }}> All</Link>|
      <Link href="#" > Category 1</Link>|
      <Link href="#" > Category 2</Link>|
      <Link href="#">Link Category 3</Link>|
      <Link href="#" > Category 4</Link>
      
   </div>
   <div className="searchText">
   <IconButton>
          <SearchIcon />
        </IconButton>
        <TextField
          style={sizetext}
          placeholder="search by product name"
          type="text"
          InputLabelProps={{
            shrink: true,
          }}
          variant="standard"
        />
        
 
   </div>
   
  
</div>


      </div>
      </div>
    )
}
const text={
    color:"#1f1d1d",
    fontSize:"3vh",
    }
    const text1={
        color:"#1f1d1d",
        fontSize:"2vh",
        }
const colorB={
    background:"#ffffff", 
}

const sizetext={
    height:"5vh",
    fontSize:"2vh",
    width:"88%"
}



export default Products;
